// Calculate Period Totals for Tax Filing
// This code processes categorized income data and calculates totals by category

const items = $input.all();

// Initialize totals object
const totals = {
  byCategory: {},
  totalRevenue: 0,
  totalTaxableAmount: 0,
  totalTax: 0,
  transactionCount: 0,
  periodStart: null,
  periodEnd: null
};

// Process each transaction
for (const item of items) {
  const data = item.json;

  // Extract relevant fields
  const category = data.category || 'Uncategorized';
  const amount = parseFloat(data.amount) || 0;
  const taxableAmount = parseFloat(data.taxableAmount) || amount;
  const taxRate = parseFloat(data.taxRate) || 0;
  const tax = taxableAmount * (taxRate / 100);
  const date = data.date || data.transactionDate;

  // Update category totals
  if (!totals.byCategory[category]) {
    totals.byCategory[category] = {
      revenue: 0,
      taxableAmount: 0,
      tax: 0,
      count: 0
    };
  }

  totals.byCategory[category].revenue += amount;
  totals.byCategory[category].taxableAmount += taxableAmount;
  totals.byCategory[category].tax += tax;
  totals.byCategory[category].count += 1;

  // Update overall totals
  totals.totalRevenue += amount;
  totals.totalTaxableAmount += taxableAmount;
  totals.totalTax += tax;
  totals.transactionCount += 1;

  // Track period dates
  if (date) {
    const transactionDate = new Date(date);
    if (!totals.periodStart || transactionDate < totals.periodStart) {
      totals.periodStart = transactionDate;
    }
    if (!totals.periodEnd || transactionDate > totals.periodEnd) {
      totals.periodEnd = transactionDate;
    }
  }
}

// Format dates
if (totals.periodStart) {
  totals.periodStart = totals.periodStart.toISOString().split('T')[0];
}
if (totals.periodEnd) {
  totals.periodEnd = totals.periodEnd.toISOString().split('T')[0];
}

// Round all monetary values to 2 decimal places
totals.totalRevenue = Math.round(totals.totalRevenue * 100) / 100;
totals.totalTaxableAmount = Math.round(totals.totalTaxableAmount * 100) / 100;
totals.totalTax = Math.round(totals.totalTax * 100) / 100;

for (const category in totals.byCategory) {
  totals.byCategory[category].revenue = Math.round(totals.byCategory[category].revenue * 100) / 100;
  totals.byCategory[category].taxableAmount = Math.round(totals.byCategory[category].taxableAmount * 100) / 100;
  totals.byCategory[category].tax = Math.round(totals.byCategory[category].tax * 100) / 100;
}

// Create summary output
const summary = {
  summary: totals,
  categories: Object.keys(totals.byCategory).map(category => ({
    category: category,
    ...totals.byCategory[category]
  })),
  transactions: items.map(item => item.json)
};

return [summary];

// Convert categorized transaction data and totals into CSV format
const items = $input.all();

// Define CSV headers
const headers = [
  'Transaction ID',
  'Source',
  'Date',
  'Amount',
  'Currency',
  'Category',
  'Taxable',
  'Tax Rate',
  'Tax Amount',
  'Description'
];

// Create CSV rows
const rows = items.map(item => {
  const data = item.json;
  return [
    data.transactionId || data.transaction_id || '',
    data.source || '',
    data.date || '',
    data.amount || '',
    data.currency || '',
    data.category || '',
    data.taxable || '',
    data.taxRate || data.tax_rate || '',
    data.taxAmount || data.tax_amount || '',
    data.description || ''
  ];
});

// Escape CSV fields (handle commas, quotes, newlines)
const escapeCSVField = (field) => {
  const fieldStr = String(field);
  if (fieldStr.includes(',') || fieldStr.includes('"') || fieldStr.includes('\n')) {
    return '"' + fieldStr.replace(/"/g, '""') + '"';
  }
  return fieldStr;
};

// Build CSV content
const csvRows = [
  headers.map(escapeCSVField).join(','),
  ...rows.map(row => row.map(escapeCSVField).join(','))
];

const csvContent = csvRows.join('\n');

// Return CSV as output
return [
  {
    json: {
      csv: csvContent,
      format: 'csv',
      rowCount: rows.length,
      generatedAt: new Date().toISOString()
    },
    binary: {
      data: {
        data: Buffer.from(csvContent).toString('base64'),
        mimeType: 'text/csv',
        fileName: `revenue_report_${new Date().toISOString().split('T')[0]}.csv`
      }
    }
  }
];

// Convert categorized transaction data and totals into XML format for government tax filing
const items = $input.all();

// Helper function to escape XML special characters
function escapeXml(unsafe) {
  if (unsafe === null || unsafe === undefined) return '';
  return String(unsafe)
    .replace(/&/g, '&amp;')
    .replace(/</g, '&lt;')
    .replace(/>/g, '&gt;')
    .replace(/"/g, '&quot;')
    .replace(/'/g, '&apos;');
}

// Helper function to format date to ISO format
function formatDate(date) {
  if (!date) return new Date().toISOString().split('T')[0];
  return new Date(date).toISOString().split('T')[0];
}

// Build XML structure
let xml = '<?xml version="1.0" encoding="UTF-8"?>\n';
xml += '<TaxFilingReport>\n';
xml += '  <Header>\n';
xml += `    <SubmissionDate>${formatDate(new Date())}</SubmissionDate>\n`;
xml += `    <TaxPeriod>${items[0]?.json?.taxPeriod || 'QUARTERLY'}</TaxPeriod>\n`;
xml += `    <FiscalYear>${new Date().getFullYear()}</FiscalYear>\n`;
xml += `    <TaxpayerID>${items[0]?.json?.taxpayerId || 'TBD'}</TaxpayerID>\n`;
xml += '  </Header>\n';

// Add summary totals
xml += '  <Summary>\n';
const totals = items[0]?.json?.totals || {};
xml += `    <TotalRevenue>${totals.totalRevenue || 0}</TotalRevenue>\n`;
xml += `    <TotalTaxableIncome>${totals.totalTaxableIncome || 0}</TotalTaxableIncome>\n`;
xml += `    <TotalDeductions>${totals.totalDeductions || 0}</TotalDeductions>\n`;
xml += `    <NetTaxableAmount>${totals.netTaxableAmount || 0}</NetTaxableAmount>\n`;
xml += `    <TransactionCount>${items.length}</TransactionCount>\n`;
xml += '  </Summary>\n';

// Add category breakdown
xml += '  <CategoryBreakdown>\n';
const categories = items[0]?.json?.categoryTotals || {};
for (const [category, amount] of Object.entries(categories)) {
  xml += '    <Category>\n';
  xml += `      <Name>${escapeXml(category)}</Name>\n`;
  xml += `      <Amount>${amount}</Amount>\n`;
  xml += '    </Category>\n';
}
xml += '  </CategoryBreakdown>\n';

// Add individual transactions
xml += '  <Transactions>\n';
for (const item of items) {
  const data = item.json;
  xml += '    <Transaction>\n';
  xml += `      <TransactionID>${escapeXml(data.transactionId || data.id)}</TransactionID>\n`;
  xml += `      <Date>${formatDate(data.date || data.transactionDate)}</Date>\n`;
  xml += `      <Source>${escapeXml(data.source || 'UNKNOWN')}</Source>\n`;
  xml += `      <Amount>${data.amount || 0}</Amount>\n`;
  xml += `      <Currency>${escapeXml(data.currency || 'USD')}</Currency>\n`;
  xml += `      <Category>${escapeXml(data.category || 'UNCATEGORIZED')}</Category>\n`;
  xml += `      <Description>${escapeXml(data.description || '')}</Description>\n`;
  xml += `      <TaxStatus>${escapeXml(data.taxStatus || 'TAXABLE')}</TaxStatus>\n`;
  if (data.customerName) {
    xml += `      <CustomerName>${escapeXml(data.customerName)}</CustomerName>\n`;
  }
  xml += '    </Transaction>\n';
}
xml += '  </Transactions>\n';

xml += '</TaxFilingReport>';

// Return the XML as output
return [{
  json: {
    xml: xml,
    format: 'XML',
    generatedAt: new Date().toISOString(),
    recordCount: items.length
  }
}];

